var settingsDict: Dictionary;

CONFIG::AIR {
	import flash.filesystem.File;
	import flash.filesystem.FileStream;

	this.stage.nativeWindow.addEventListener(Event.CLOSING, closeStream);

	var isLogFileOpen: Boolean = false;
	// Text file for logs
	var logFile: File;
	var optionsFile: File;
	var stream: FileStream = new FileStream();
	var optionsStream: FileStream = new FileStream();

	// Can not extract keys from dictionary so must make arrays instead
	var keys: Array = new Array("Vanilla");
	var defValues: Array = new Array(false);
	// Pattern to detect letters in a string
	var lettersPattern: RegExp = /[a-zA-Z]/g;

	// Get files from given location (Log and config files)
	logFile = File.applicationStorageDirectory.resolvePath("Log.txt");
	optionsFile = File.applicationStorageDirectory.resolvePath("config.txt");
	trace("Log file at " + logFile.nativePath);

	var testDict: Dictionary = new Dictionary();

	// Try opening file
	try {
		// Open in async (Keep on background)
		stream.openAsync(logFile, FileMode.WRITE);
		trace("Opened log file stream");
		isLogFileOpen = true;
	} catch (error: Error) {
		// No logs would be able to be saved
		trace("Could not open log file");
	}

	// Load settings at launch
	settingsDict = loadSettings();

	// Save trace text to log file
	function traceLog(txt): void {
		if (isLogFileOpen) {
			var text = txt as String;
			trace(txt);
			stream.writeUTFBytes(text + "\n");
		}
	}

	// Closes file stream
	function closeStream(evt: Event): void {
		if (isLogFileOpen) {
			trace("Closing file stream");
			stream.close();
			isLogFileOpen = false;
		}
	}

	// Saves config file with given dictionary. Format: "key=value" per line
	function saveSettings(dict: Dictionary): void {
		try {
			optionsStream.open(optionsFile, FileMode.WRITE);
			var writeLine: String;

			// Save in format: "key=value" in config file
			for (var i: uint = 0; i < keys.length; i++) {
				writeLine = keys[i] + "=" + dict[keys[i]];
				traceLog("Writing " + writeLine);
				optionsStream.writeUTFBytes(writeLine);
			}

			traceLog("Finished writing to config file");
		} catch (error: Error) {
			traceLog(error);
		}
	}

	/* Opens and reads config file
	 * Format: "key=value" per line
	 * Key and value are used to set values in dictionary
	 */
	function loadSettings(): Dictionary {
		var dict: Dictionary = new Dictionary();
		try {
			optionsStream.open(optionsFile, FileMode.READ)
			var fileContent: String = optionsStream.readUTFBytes(optionsStream.bytesAvailable);
			var contents: Array = fileContent.split("\n");

			for (var i: uint = 0; i < contents.length; i++) {
				// Seperate line by '=' then add content to dict
				var stringPair: Array = contents[i].split("=");

				// CHECK INVALID SAVE FILE
				if (stringPair.length != 2) {
					traceLog("Invalid mod loader config file");
					traceLog("Replacing config file");
					saveSettings(getDefaultDict());
					return dict;
				}
				// First check if value is a true/false
				if (stringPair[1] == "true")
					dict[stringPair[0]] = true;
				else if (stringPair[1] == "false")
					dict[stringPair[0]] = false;
				// Second check if it is a number
				else if (stringPair[1].search(lettersPattern) == -1)
					dict[stringPair[0]] = parseInt(stringPair[1], 10);
				// If no condition was entered then the value is a String
				else
					dict[stringPair[0]] = stringPair[1];
			}
			traceLog("Finished reading config file");
			optionsStream.close();

			return dict;
		} catch (error: Error) {
			// Create config file with default data
			traceLog("Creating config file");
		}
		saveSettings(getDefaultDict());
		return dict;
	}

	// Return a default dictionary
	function getDefaultDict(): Dictionary {
		var dict: Dictionary = new Dictionary();
		for (var i: uint = 0; i < keys.length; i++) {
			dict[keys[i]] = defValues[i];
		}
		return dict;
	}
}

