// Called when settings button is pressed
function Settings(): void {
	// Return to NOTES when pressing settings button again
	if (currentFrame == SETTINGS) {
		gotoAndStop(NOTES);
		butSettings.hideGlowLine();
		return;
	}
	butSettings.showGlowLine();
	butMods.hideGlowLine();
	gotoAndStop(SETTINGS);
}

// Called when mods button is pressed
function ShowMods(): void {
	// Return to NOTES when pressing mdos button again
	if (currentFrame == MODS) {
		gotoAndStop(NOTES);
		butMods.hideGlowLine();
		return;
	}
	butSettings.hideGlowLine();
	butMods.showGlowLine();
	gotoAndStop(MODS);
}

// WINDOW OPTIONS (For game)
var windowOptions: NativeWindowInitOptions = new NativeWindowInitOptions();
//windowOptions.owner = stage.nativeWindow; //setting the owner to the main window means that if this main window is closed, it will also close this new window
windowOptions.renderMode = NativeWindowRenderMode.AUTO;
windowOptions.resizable = true;
windowOptions.minimizable = true;
windowOptions.maximizable = true;
windowOptions.systemChrome = NativeWindowSystemChrome.NONE;

// Window variables
var newScreen: NativeWindow;

// Launch game
function LaunchGame(): void {
	// Hide glow lines (none selected)
	butSettings.hideGlowLine();
	butMods.hideGlowLine();

	traceLog("*** Launching game ***");
	// Create a Window
	newScreen = new NativeWindow(windowOptions);
	newScreen.title = "Armed with Wings Modded";

	loader.contentLoaderInfo.addEventListener(Event.COMPLETE, InitTarget, false, 0, true);

	newScreen.maximize();
	newScreen.stage.displayState = StageDisplayState.FULL_SCREEN_INTERACTIVE;
	newScreen.activate();
	newScreen.stage.addChild(loader);
	loader.x = 0;
	loader.y = 0;
	newScreen.stage.nativeWindow.addEventListener(Event.CLOSE, AppClosed);
	butLaunch.disable();
	// Fix mouse after clicking launch
	Mouse.cursor = MouseCursor.AUTO

	loader.load(swfRequest);
}

// Clean up after closing the game
function AppClosed(evt: Event): void {
	target = null;
	loader.unloadAndStop();
	loader = new Loader();
	traceLog("*** Game Closed ***");

	// Re-enable the launch button after game is closed
	butLaunch.enable();
	Mouse.show();
}

// Called after game swf is loaded. Initializes target to the loaded swf.
function InitTarget(evt: Event): void {
	traceLog("Done loading swf");
	// Target contains access to the RUNNING game code
	target = evt.currentTarget.loader.content as MovieClip;

	// Tell base mod to start loading mods
	BaseMod.initMod(target);
	BaseMod.loadMods();

	traceLog(target.gameVersion);

	//this.gotoAndPlay(2);
}

// Adds mods to the mod container
function addModsToContainer(modDatas: Array, baseMod: MovieClip): void {
	for (var i: uint = 0; i < modDatas.length; i++)
		modTabContainer.addMod(modDatas[i], i, baseMod);
}

this.stop();

import flash.display.MovieClip;
target.addEventListener(Event.EXIT_FRAME, CheckInit)
// Checks if the game is done loading initial data (Repeats until game is initialised)
function CheckInit(evt: Event): void {
	traceLog("Checking Init");

	// If target is lost (Closed/Crashed before initializing)
	if (target == null) {
		this.stop();
		return;
	}
	// If the scene changed to launch notes then the game has been initialized
	if (target.currentScene.name == "Launch Notes") {
		traceLog("stopping init checks");
		traceLog("Game finished initialising");
		target.removeEventListener(Event.EXIT_FRAME, CheckInit)
		// Perform after game initialization code
		this.gotoAndStop(17);
		return;
	}
}
