function KeyHandler(evt: KeyboardEvent): void {
	if (evt.keyCode == 116) {
		if (target.fullscreen) {
			target.displayWindow();
			target.fullscreen = false;
		} else {
			target.displayFullscreen();
			target.fullscreen = true;
		}
	}
}

