function gameDisplayFullscreen(): void {
	traceLog("Fullscreen ON");

	target.scaleFactor = 1;
	target.data_scaleFator = 1;
	target.scaleX = target.scaleY = target.scaleFactor;

	target.x = 0;
	target.y = 0;

	newScreen.stage.fullScreenSourceRect = new Rectangle(0, 0, target.gameWidth * target.scaleFactor, target.gameHeight * target.scaleFactor);
	newScreen.stage.displayState = StageDisplayState.FULL_SCREEN_INTERACTIVE;

	var pp: PerspectiveProjection = new PerspectiveProjection();

	pp.projectionCenter = new Point((target.gameWidth * target.data_scaleFactor) * .5, (target.gameHeight * target.data_scaleFactor) * .5);
	target.transform.perspectiveProjection = pp;
	target.fullscreen = true;
}

// Saves the game data
