/* SETTINGS MENU*/
settingsContainer.checkVanilla.Connect(pressedVanilla);

setSettings();

function setSettings(): void {
	if (settingsDict["Vanilla"])
		settingsContainer.checkVanilla.forceCheck();
	else
		settingsContainer.checkVanilla.forceUncheck();
}

function pressedVanilla(): void {
	settingsDict["Vanilla"] = !settingsDict["Vanilla"];
	saveSettings(settingsDict);
}
